// src/pages/Dashboard.js
import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { motion } from 'framer-motion'; // Add this import
import Header from '../components/Header';
import Footer from '../components/Footer';
import { classifyQuery } from '../services/queryService';
import '../styles/Dashboard.css';

const Dashboard = () => {
  const [query, setQuery] = useState('');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [userLocation, setUserLocation] = useState('');
  const navigate = useNavigate();

  // Animation variants
  const containerVariants = {
    hidden: { opacity: 0 },
    visible: { 
      opacity: 1,
      transition: { duration: 0.5, when: "beforeChildren", staggerChildren: 0.2 }
    }
  };
  
  const itemVariants = {
    hidden: { y: 20, opacity: 0 },
    visible: { y: 0, opacity: 1, transition: { duration: 0.4 } }
  };

  useEffect(() => {
    // Load user location from localStorage when component mounts
    const storedLocation = localStorage.getItem('userLocation');
    if (storedLocation) {
      setUserLocation(storedLocation);
    }
    
    // Add subtle background animation
    document.body.classList.add('animated-bg');
    
    return () => {
      document.body.classList.remove('animated-bg');
    };
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!query.trim()) {
      setError('Please enter a query');
      return;
    }
    
    setLoading(true);
    setError('');
    
    try {
      // Button loading animation
      const button = e.target.querySelector('button');
      button.classList.add('loading');
      
      // Enhance query with location if available
      const enhancedQuery = userLocation ? `${query} in ${userLocation}` : query;
      console.log(`Processing enhanced query: ${enhancedQuery}`);
      
      const response = await classifyQuery(enhancedQuery);
      
      // Add a small delay for the animation to complete
      setTimeout(() => {
        navigate('/classification', { 
          state: { 
            classifications: response.data.classifications,
            query: enhancedQuery // Pass enhanced query to next page
          }
        });
      }, 300);
    } 
    catch (err) {
      setError('Error processing query: ' + (err.response?.data?.message || err.message));
    } finally {
      setLoading(false);
    }
  };

  return (
    <motion.div 
      className="dashboard-page"
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 0.6 }}
    >
      <Header />
      
      <main className="dashboard-container">
        <motion.div 
          className="dashboard-content"
          variants={containerVariants}
          initial="hidden"
          animate="visible"
        >
          <motion.h2 variants={itemVariants}>Find the perfect professional for your needs</motion.h2>
          <motion.p variants={itemVariants}>Describe your project or requirements, and we'll match you with the best experts.</motion.p>
          
          {userLocation && (
            <motion.div 
              className="location-indicator"
              variants={itemVariants}
              initial={{ opacity: 0, x: -20 }}
              animate={{ opacity: 1, x: 0 }}
              transition={{ delay: 0.3 }}
            >
              Your location: <strong>{userLocation}</strong> 
              <motion.button 
                className="change-location-btn"
                onClick={() => navigate('/location')}
                whileHover={{ scale: 1.05 }}
                whileTap={{ scale: 0.95 }}
              >
                Change
              </motion.button>
            </motion.div>
          )}
          
          {error && (
            <motion.div 
              className="error-message"
              initial={{ opacity: 0 }}
              animate={{ opacity: 1 }}
              transition={{ duration: 0.3 }}
            >
              {error}
            </motion.div>
          )}
          
          <motion.form 
            onSubmit={handleSubmit} 
            className="query-form"
            variants={itemVariants}
          >
            <motion.textarea
              value={query}
              onChange={(e) => setQuery(e.target.value)}
              placeholder="E.g., I need a doctor who specializes in pediatric neurology..."
              rows={5}
              required
              variants={itemVariants}
              whileFocus={{ boxShadow: "0 0 0 3px rgba(37, 99, 235, 0.2)" }}
            />
            <motion.button 
              type="submit" 
              disabled={loading}
              variants={itemVariants}
              whileHover={{ scale: 1.02 }}
              whileTap={{ scale: 0.98 }}
            >
              {loading ? (
                <>
                  <span className="loading-spinner"></span> Processing...
                </>
              ) : (
                'Find Professionals'
              )}
            </motion.button>
          </motion.form>
        </motion.div>
      </main>
      
      <Footer />
    </motion.div>
  );
};

export default Dashboard;
